import React from 'react'
import GoogleLoginBtn from 'react-google-login'
import './FacebookGoogle.css'
import {userLoad} from '../../../redux/AuthReducer'
import { connect } from 'react-redux'
export const GoogleLogin = () => {
    const responseGoogle = (response) => {
        console.log(response);
        let userData={
            name:response.profileObj.name,
            img:response.profileObj.imageUrl,
            email:response.profileObj.email
        }
        this.props.userLoad()
    }





    return (
        <GoogleLoginBtn
        clientId="566501002041-u2a7osr7ah155liop5pdd485qolqul7d.apps.googleusercontent.com"
        buttonText="Login"
        onSuccess={responseGoogle}
        onFailure={responseGoogle}
        render={renderProps => (
        <img src="images/svg/Vector (23).svg" onClick={renderProps.onClick} disabled={renderProps.disabled} className="googleIcon"/>   
          )}
        cookiePolicy={'single_host_origin'}
    />
    )

}

export default connect(null,{userLoad})(GoogleLogin)
